import React from 'react';
//import ReactDOM from 'react-dom';
import 'bulma/css/bulma.css'
import '../components/main.css'


const footerbg ={
    backgroundColor:'teal',
    padding:'2rem 1.5rem 2rem'
}

const Footer = () => {
return(
    <footer className="footer" style={footerbg}>
    <div class="columns">
    <div class="column">
    <label class="label">Total Checked-In</label>
    </div>
    <div class="column">
      Second column
    </div>
    <div class="column">
      Third column
    </div>
    <div class="column">
      Fourth column
    </div>
  </div>



    <div className="content">

       <button className="button is-success is-inverted" >Add Participant</button>
    </div>
    </footer>
)
};

export default Footer;
